    <style>
      .sidebar-header > div:first-of-type::after {
        content: 'Vuelace-3';
        color: white;
        font-size: 1.1rem;
      }

      .sidebar-header > div:first-of-type > a > img {
        width: 64px;
        object-fit: contain;
      }

      .sidebar-header > div:first-of-type > a {
        box-sizing: content-box;
        max-width: 72px;
        background-color: white;
        border-radius: 100%;
        margin-right: 10px;
        padding-left: 8px;
        padding-right: 0;

    <style>
      #storybook-root[hidden] {
        display: none !important;
      }
    </style>

    
  </head>
  <body>
    <div id="root"></div>

    
    <script>
      
        
          window['FEATURES'] = {
  "argTypeTargetsV7": true,
  "legacyDecoratorFileOrder": false,
  "disallowImplicitActionsInRenderV8": true
};
        
      
        
          window['REFS'] = {};
        
      
        
          window['LOGLEVEL'] = "info";
        
      
        
          window['DOCS_OPTIONS'] = {
  "defaultName": "Docs",
  "autodocs": "tag"
};
        
      
        
          window['CONFIG_TYPE'] = "PRODUCTION";
        
      
        
      
        
      
        
          window['TAGS_OPTIONS'] = {
  "dev-only": {
    "excludeFromDocsStories": true
  },
  "docs-only": {
    "excludeFromSidebar": true
  },
  "test-only": {
    "excludeFromSidebar": true,
    "excludeFromDocsStories": true
  }
};
        
      
        
          window['STORYBOOK_RENDERER'] = "vue3";
        
      
        
          window['STORYBOOK_BUILDER'] = "@storybook/builder-vite";
        
      
        
          window['STORYBOOK_FRAMEWORK'] = "@storybook/vue3-vite";
        
      
    </script>
    

    <script type="module">
      import './sb-manager/globals-runtime.js';

      import './sb-manager/runtime.js';
    </script>
